    <p class=MsoNormal><b style='mso-bidi-font-weight:normal'><span
    style='font-size:20.0pt;line-height:107%;font-family:"Arial",sans-serif'>Fundada<o:p></o:p></span></b></p>
    <p style='margin-top:0cm;margin-right:0cm;margin-bottom:7.5pt;margin-left:
    0cm;text-align:justify'><span style='font-family:"Arial",sans-serif'>Era el
    año de 2011 cuando Andrés Manuel López Obrador siguiendo una estrategia de
    divulgación de su proyecto político recorrió la totalidad de los municipios
    del país. Esto lo llevó a constituir en 2011 una asociación civil (Morena)
    que respaldara su candidatura y movilizara a la gente en pos de una
    eventual defensa del voto.<o:p></o:p></span></p>
    <p style='margin:0cm;margin-bottom:.0001pt;text-align:justify'><span
    style='font-family:"Arial",sans-serif'>Morena (conocido también como
    Movimiento Regeneración Nacional, por el nombre de la asociación civil que
    le dio origen) Fue creado el 2 de octubre de 2011 como un movimiento
    político y social impulsado por Andrés Manuel López Obrador, como parte de
    su campaña presidencial en las elecciones federales de 2012. Más tarde el
    movimiento se constituyó como una asociación civil el 20 de noviembre de
    2012.<o:p></o:p></span></p>
    <p class=MsoNormal><b style='mso-bidi-font-weight:normal'><span
    style='font-size:12.0pt;line-height:107%;font-family:"Arial",sans-serif'><o:p>&nbsp;</o:p></span></b></p>
